    <script>
      document.addEventListener("DOMContentLoaded", (event) => {
        const links = document.getElementsByClassName('a-href');

        // Add event listener to each link
        Array.from(links).forEach(link => {
          link.addEventListener('click', (e) => {
            if (link.contains(e.target)) {
              e.preventDefault()

              const term = link.getAttribute('data-term');
              let requestId = '68066f84-7114-46ba-a5e6-d80580d00829';
              // Check if the href contains "kineticharbor.com"
              if (!link.href.includes("kineticharbor.com")) {
                requestId += "_zp"; // Append "zp" if it's an external link
              }
              fetch('/munin/' + requestId + '?t=' + term)
                      .then(() => {
                        location.assign(link.href)
                      })
                      .catch((error) => {
                        console.error('Error fetching /munin:', error);
                        location.assign(link.href)
                      });
            }
          });
        });
      });
    </script>
